(550, NULL, 'Net Enrolment Rate Report', 'تقرير صافي معدل الالتحاق', '净入学率报告', 'Informe de la  tasa neta de la matrícula', NULL, 'Отчет по коэффициенту зачисления', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(551, NULL, 'Divide the number of pupils (or students) enrolled who are of the official age group for a given level of education by the population for the same age group and multiply the result by 100. This indicator has dimension values of sex, locality and grade.', 'قسّم عدد التلاميذ  الملتحقين الذين هم من الفئة العمرية الرسمية لمستوى معين من التعليم على السكان من نفس الفئة العمرية، اجمع واضرب النتيجة في 100  هذا المؤشر له قِيَم البعد للجنس والمكان والصفّ', '以同年龄组别受教育程为总人数， 除以达到入学年龄的注册学生人数，再乘以结果的100。该指标包含性别，地区和年级数据。', 'Se divide el número de alumnos (o estudiantes) matriculados que son del grupo de edad oficial para un determinado nivel de educación por el total de la población para el mismo grupo de edad y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de género, localidad y grado.', 'Divisez le nombre d''élèves (ou étudiants) inscrits qui sont du groupe d''âge officiel à un niveau d''enseignement donné par la population de la même tranche d''âge, et multipliez le résultat par 100. Cet indicateur a des ', 'Разделите количество зачисленных учащихся (или студентов), в официальный возрастной группе для данного уровня образования на население в той же возрастной группе и умножьте результат на 100. Этот показатель различается по полу, местности и классам.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(552, NULL, 'Gross Enrolment Rate Report', 'تقرير إجمالي معدّل الالتحاق ', '毛入学率报告', 'Informe de la tasa bruta de matrícula ', NULL, 'Отчет по общему коэффициенту зачисления', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(553, NULL, 'Net Intake Rate Report', 'تقريرصافي معدل القبول', '净录取率报告', 'Informe de la tasa neta de ingreso ', NULL, 'Отчет по коэффициенту чистого приема', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(554, NULL, 'Divide the number of children of official primary school-entrance age who enter the first grade of primary education for the first time by the population of the same age, and multiply the result by 100. This indicator has dimension values of sex and locality.', 'قسّم عدد الأطفال في سن المدرسة الرسمية، الذين يدخلون السنة الأولى من المرحلة الابتدائية  لأوّل مرة على السكان من نفس العمر، واضرب النتيجة في 100. هذا المؤشر له قِيَم البعد عن للجنس والمكان', '正式的小学入学年龄的儿童进入小学一年级的小学教育，第一次由同年龄的人口数除以，然后将结果乘以100。该指标包含性别和地区数据。', 'Se divide el número de niños de edad para entrar a primaria que ingresan al primer grado por primera vez por la población de la misma edad, y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de sexo y localidad.', 'Divisez le nombre d''enfants de l''école primaire d’âge officiel d''entrée qui entrent en première année de l''enseignement primaire pour la première fois par la population du même âge, et multipliez le résultat par 100. Cet indicateur a des valeurs de dimension par rapport au sexe et à la localité.', 'Разделите число детей официального младшего школьного возраста, которые входом введите первый класс начальной школы в первый раз со стороны населения того же возраста, и умножить результат на 100. Этот показатель имеет размерность значения сексу и местности.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(555, NULL, 'Gross Intake Rate Report', 'تقرير معدل إجمالي القبول', '毛入学率报告', 'Informe Tasa Bruta de Admisión', NULL, 'Отчет по общему коэффициенту приема', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(556, NULL, 'Divide the number of pupils (or students) enrolled in a given level of education regardless of age by the population of the age group which officially corresponds to the given level of education, and multiply the result by 100. This indicator has dimension values of sex, locality and grade.', 'تقسيم عدد التلاميذ (أو الطلاب) المقيدين في مرحلة معينة من التعليم بغض النظر عن العمر من قبل السكان من الفئة العمرية التي تتطابق رسميا إلى مستوى معين من التعليم، وضرب الناتج في 100. هذا المؤشر له قيم البعد عن الجنس والمكان والصف', '划分的学生人数（或学生）参加在给定的教育水平，不论年龄由年龄组正式对应于给定的受教育程度的人口，将结果乘以100。该指标包含性别，地区和年级数据。', 'Se divide el número de alumnos (o estudiantes) matriculados en un determinado nivel de educación, independientemente de la edad, por el numero total de la población de la edad que oficialmente corresponde al nivel de educación dado, y  se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de género, localidad y grado.', 'Divisez le nombre d''élèves (ou étudiants) inscrits dans un niveau d''enseignement donné, quel que soit l''âgequi correspond officiellement au niveau d''enseignement donné, et multipliez le résultat par 100. Cet indicateur a des valeurs de dimension par rapport ausexe, à la localité et au niveau scolaire.', 'Разделите количество учащихся (или студентов), обучающихся на данном уровне образования, независимо от возраста, на население возрастной группы, которая официально соответствует данному уровню образования, и умножьте результат на 100. Этот показатель различается по полу, местности и классам.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(557, NULL, 'Divide the number of new entrants in grade 1, irrespective of age, by the population of official school-entrance age, and multiply the result by 100. This indicator has dimension values of sex, locality and grade.', 'قسّم عدد الداخلين الجدد في الصف 1، بغض النظر عن العمر، من قبل السكان في سن المدرسة الرسمية مدخل، ومضاعفة النتيجة عن طريق 100. هذا المؤشر له قيم البعد من المكان والجنس والصف', '新进入者的数量除以1级，不论年龄大小，人口的官方学校 - 入学年龄，并且将结果乘以100。该指标包含性别和地区数据。', 'Se divide el número de entrantes en primer grado, independiente de la edad, por la población total de edad para ingresar a la de la escuela y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de género, localidad y grado.', 'Divisez le nombre de nouveaux entrants en 1ère année, indépendamment de leur âge, par la population de l''école en âge d''entrée officiel, et multipliez le résultat par 100. Cet indicateur a des valeurs de dimension par rapport au sexe, à la ', 'Разделите число учащихся, поступивших в 1-й класс, независимо от возраста, ', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(558, NULL, 'Repetition Rate Report', 'تقرير معدل الإعادة', '重读率报告', ' Informe de tasa de repetición ', 'Rapport Taux de redoublement', 'Отчет по коэффициенту повторения', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(559, NULL, 'Divide the number of repeaters in a given grade in school year t+1 by the number of pupils from the same cohort enrolled in the same grade in the previous school year t . This indicator has dimension values of sex, locality, sector and grade.', 'تقسيم عدد من الراسبين في الصف في العام الدراسي نظرا T +1 من قبل عدد من التلاميذ من نفس الفوج المسجلين في الصف نفسه في مدرسة ر العام السابق. هذا المؤشر له قيم البعد بسبب الجنس أو القطاع، ومحلة الصف.', '中继器的数量在一个给定的等级，在学年 t +1分的学生人数从同一队列登记在同一个档次上一学年度。该指标包含性别，地区，单位和年级数据。', 'Se divide el número de repetidores en un grado dado en un año escolar t +1 por el número de alumnos del mismo cohorte matriculados en el mismo grado en la escuela año anterior, t. Este indicador tiene valores en las dimensiones del sexo, localidad, sector y grado.', 'Divisez le nombre de redoublants dans une classe donnée pour l''année scolaire t +1 par le nombre d''élèves de la même cohorte inscrits dans la même classe durant l’année scolaire précédente. Cet indicateur a des ', NULL, 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(560, NULL, 'Completion Rate Report', 'تقرير معدل التخرج', '完成率报告', 'Informe de tasa de finalización', 'Rapport du Taux d''Achèvement', 'Отчет по коэффициенту окончания', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(561, NULL, 'Divide the number of primary graduates, irrespective of age, by the population of theoretical primary graduation, and multiply the result by 100. This indicator has dimension values of sex, locality and sector.', 'قسّم عدد خريجي المرحلة الابتدائية، بغض النظر عن السنّ، من سكان التخرج الأولية النظرية، واضرب النتيجة في 100. هذا المؤشر له قيم البعد للجنس والموقع المحلي والقطاع', '将这个数字的小学毕业生，不论年龄大小，人口理论小学毕业，并且将结果乘以100。该指标包含性别，地区和单位数据。', 'Se divide el número de graduados de primaria, independientemente de su edad, por la población teóricamente graduada de primaria,  y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiónes de género, localidad y sector.', 'Divisez le nombre de diplômés du primaire, indépendamment de l''âge, par la population qui aurait théoriquement du obtenir le  diplôme primaire, et multipliez le résultat par 100. Cet indicateur a des valeurs de dimension par rapport au sexe, à la localité et au secteur.', 'Разделите число выпускников начальной школы, независимо от возраста на теоретическое число выпускников и умножьте результат на 100. Этот показатель различается по полу, местности, секторам.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(562, NULL, 'Survival Rate Report', 'معدل البقاء تقرير', '存活率报告', 'Informe de la Tasa de Supervivencia ', 'Rapport sur le Taux de Survie', 'Отчет по выживаемости', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(563, NULL, 'Divide the total number of pupils belonging to a school-cohort who reached each successive grade of the specified level of education by the number of pupils in the school-cohort i.e. those originally enrolled in the first grade of primary education, and multiply the result by 100. The survival rate is calculated on the basis of the reconstructed cohort method, which uses data on enrolment and repeaters for two consecutive years. This indicator has dimension values of sex, locality and sector.', 'تقسيم العدد الإجمالي للتلاميذ الذين ينتمون إلى الفوج المدرسي الذي بلغ كل صف المتتالية للمستوى المحدد من قبل التعليم عدد التلاميذ في الفوج المدرسي أي أولئك المنخرطين أصلا في الصف الأول من التعليم الابتدائي، ومضاعفة النتيجة عن طريق 100. يتم حساب معدل البقاء على قيد الحياة على أساس طريقة الفوج أعيد بناؤها، والذي يستخدم بيانات عن معدلات الالتحاق بالمدارس والراسبين لعامين متتاليين. هذا المؤشر له قيم البعد من المكان والجنس والقطاع.', '分属于一所学校？队列，每个学校的学生人数在连续级指定的受教育程度达到学生总人数的吗？队列即那些原本就读于一年级的小学教育，将结果乘以100。生存率的计算方法的基础上重建队列方法，它使用了连续两年的入学和中继器的数据。该指标包含性别，地区和单位数据。', 'Se divide el número total de alumnos que pertenecen a un cohorte escolar que alcanzó cada grado sucesivo del nivel educativo especificado por el número de alumnos en la cohorte escolar es decir, aquellos originalmente inscrito en el primer grado de educación primaria, y se multiplica el resultado por 100. La tasa de supervivencia se calcula sobre la base del método de cohorte reconstruida, que utiliza los datos de matrícula y repetidores por dos años consecutivos. Este indicador tiene valores en las dimensiónes de género, localidad y sector.', 'Divisez le nombre total d''élèves appartenant à une école-cohorte qui ont atteint chaque année d''études de manière successives donné par le nombre d''élèves dans l''école-cohorte, c’est-à-dire ceux qui étaient initialement inscrits en première année de l''enseignement primaire, et multiplier le résultat par 100. Le taux de survie est calculé sur la base de la méthode de la cohorte reconstituée, qui utilise des données sur les effectifs et les redoublants pour deux années consécutives. Cet indicateur a des valeurs ', 'Разделить общее количество учеников, принадлежащих к когорте школы, которые доучились до класса, указанного уровнем образования на количество ', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(564, NULL, 'Transition Rate Report', 'تقرير قيم الانتقال', '转校率报告', 'Informe de Tasa de Transición ', 'Rapport du Taux de Transition', 'Отчет по коэффициенту перехода', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(565, NULL, 'Divide the number of new entrants in the first grade of the specified higher cycle or level of education by the number of pupils who were enrolled in the final grade of the preceding cycle or level of education in the previous school year, and multiply by 100. This indicator has dimension values of sex, locality, sector and grade.', 'تقسيم عدد الداخلين الجدد في الصف الأول من دورة محددة أو ارتفاع مستوى التعليم من قبل عدد من التلاميذ الذين كانوا مسجلين في الصف النهائي من دورة السابقة أو مستوى التعليم في السنة الدراسية السابقة، وتتضاعف بنسبة 100. هذا المؤشر له قيم البعد بسبب الجنس أو القطاع، ومحلة الصف.', '数除以一年级的新进入者在指定的周期或受教育程度的学生被纳入最终成绩的前一个周期或在上一学年的教育水平，再乘以100。该指标包含性别，地区，单位和年级数据。', 'Se divide el número de nuevos ingresos en el primer grado del ciclo o nivel superior educativo especificado  por el número de alumnos que se inscribieron en grado final del ciclo anterior o el nivel de educación en el anterior año escolar, y se multiplica por 100. Este indicador tiene valores en las dimensiones del sexo, localidad, sector y grado.', 'Divisez le nombre de nouveaux entrants en première année du cycle supérieur spécifié ou au niveau scolaire par le nombre d''élèves qui étaient inscrits en dernière année du cycle précédent ou au niveau scolaire de ', 'Разделите число учащихся, поступивших в первый класс, указанного ранее цикла или уровня образования на количество учеников, которые были зачислены в последний класс, предшествующего цикла или уровня образования в предыдущем учебном году и умножьте на 100. Этот показатель различается по полу, местности, сектору и классам.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(566, NULL, 'Pupil Teacher Ratio Report', 'تقرير التلميذ المعلم النسبة', '学生与教师的比率报告', 'Informe de proporción profesor-alumno', 'Rapport sur le Ratio Elèves-Enseignants', 'Отчет по соотношению учеников к учителям', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(567, NULL, 'Divide the total number of pupils enrolled at the specified level of education by the number of teachers at the same level. This indicator has dimension values of locality, sector and level of education.', 'تقسيم العدد الإجمالي للتلاميذ المسجلين في مستوى تعليميا معينا من قبل عدد من المعلمين في نفس المستوى. هذا المؤشر له قيم البعد من القطاع، محلة ومستوى التعليم', '总数除以学生人数在指定的受教育程度在同级别的教师人数。该指标包含地区，单位和教育程度数据。', 'Se divide el número total de alumnos matriculados en el nivel especificado de la educación por el número de profesores en el mismo nivel. Este indicador tiene valores en las dimensiónes de la localidad, sector y nivel de educación.', 'Divisez le nombre total d''élèves inscrits au niveau d''enseignement donné par le nombre d''enseignants au même niveau. Cet indicateur a des valeurs dimensionnelles sur la localité, le secteur et le niveau d''éducation.', 'Разделить общее количество учащихся на определенном уровне образования на число учителей на том же уровне. Этот показатель различается по местности, сектору и уровню образования.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(568, NULL, 'Pupil Class Ratio Report', 'تقرير معدّل التلميذ  - الصف ', '学生与班级的比率报告', 'Informe de proporción de Clase a Alumno', 'Rapport sur le Ratio Elève-Classe', 'Отчет по соотношению учеников к классу', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(569, NULL, 'Divide the total number of pupils enrolled at the specified level of education by the number of classes at the same level. This indicator has dimension values of locality and sector.', 'تقسيم العدد الإجمالي للتلاميذ المسجلين في مستوى تعليميا معينا من قبل عدد من الطبقات في نفس المستوى. هذا المؤشر له قيم البعد من محلة والقطاع', '总数除以学生人数在指定的受教育程度在同级别的班级数目。该指标包含地区和单位数据。', 'Se divide el número total de alumnos matriculados en el nivel especificado de la educación por el número de clases en el mismo nivel. Este indicador tiene valores de la dimensión de la localidad y sector.', 'Divisez le nombre total d''élèves inscrits au niveau d''enseignement donné par le nombre de classes de même niveau. Cet indicateur a valeurs ', 'Разделить общее количество учащихся на заданном уровне образования на число классов на том же уровне. Этот показатель различается по местности и секторам.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(570, NULL, 'Trained Teachers Report', 'تقرير عن المعلمين المدربين', '经过培训的教师报告', 'Informe de los Maestros Capacitados ', NULL, 'Отчет по квалифицированным учителям ', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(571, NULL, 'Divide the number of teachers of the specified level of education who have received the minimum required teacher training by the total number of teachers at the same level of education, and multiply the result by 100. This indicator has dimension values of locality, sector and level of education.', 'قسّم عدد المعلمين من المستوى المعيّن من التعليم الذين حصلوا على الحد الأدنى المطلوب لتدريب المعلمين على العدد الكلي للمعلمين في نفس المستوى من التعليم، واضرب النتيجة في 100. هذا المؤشر له قيم البعد للموقع المحلي والقطاع،  ومستوى التعليم', '数除以教师指定级别的教育已经收到了教师总人数的最低要求教师培训在同等水平的教育，然后将结果乘以100。该指标包含地区，单位和教育程度数据。', 'Se divide el número de profesores del nivel especificado de la educación que han recibido la formación mínima requerida por el número total de docentes en el mismo nivel de educación, y se multiplica el resultado por 100. Este indicador tiene valores de la dimensión de la localidad, sector y nivel de educación.', 'Divisez le nombre d''enseignants du niveau spécifié d''éducation qui ont reçu la formation des enseignants minimum requis par le nombre total d''enseignants au même niveau d''éducation, et multipliez le résultat par 100. Cet indicateur a valeurs dimensionnelles sur la localité, le secteur et le niveau d''éducation.', 'Разделите количество учителей, указанного уровня образования, которые ', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(572, NULL, 'Gender Parity Index (Students) Report', 'تقرير مؤشر التكافؤ بين الجنسين للطلاب', '性别平均指数（学生）报告', 'Informe Índice de Paridad de Género (Estudiantes) ', NULL, 'Отчет по индексу гендерного паритета (студенты)', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(573, NULL, 'Divide the number of female students by the number of male students. This indicator has dimension values of sex, locality, sector and level of education.', 'قسّم عدد الطالبات على عدد الطلاب الذكور. هذا المؤشر له قيم البعد للجنس و الموقع المحلي والقطاع ومستوى التعليم', '划分的女性价值的一个给定指标的男性。该指标包含性别，地区，单位和教育程度数据。', 'Dividir el número de estudiantes de sexo femenino por el número de estudiantes de sexo masculino. Este indicador tiene valores en las dimensiónes del sexo, localidad, sector y nivel de educación.', 'Divisez le nombre d''étudiantes par le nombre d''élèves de sexe masculin. Cet indicateur a des valeurs de dimension sur le sexe, la localité, le secteur et le niveau d''éducation.', 'Разделите число студенток на количеству студентов мужского пола. Этот показатель различается по полу, местности, сектору и образованию.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(574, NULL, 'Female Students Report', 'تقرير عن الطالبات', '女学生报告', 'Informe de Estudiantes Femeninos ', NULL, 'Отчет по студенткам ', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46');
INSERT INTO `translations` (`id`, `code`, `eng`, `ara`, `chi`, `spa`, `fre`, `rus`, `modified_user_id`, `modified`, `created_user_id`, `created`) VALUES
(575, NULL, 'Divide the number of female tertiary students enrolled in a specified ISCED level by the total number of students (male plus female) in that level in a given academic-year, and multiply the result by 100. This indicator has dimension values of locality, sector and level of education.', 'قسّم عدد طالبات التعليم العالي المقيدات في مستوى ISCED معيّن على العدد الكلي للطلاب  (الذكور بالإضافة إلى الإناث) في هذا المستوى في عام دراسيّ معين، واضرب النتيجة في 100. هذا المؤشر له قيم البعد للموقع المحلي والقطاع ومستوى التعليم', 'ISCED水平在指定的学生总人数（男加女），在一个给定的学术年就读于女性大专学生，将这个数字将结果乘以100。该指标包含地区，单位和教育程度数据。', 'Se divide el número de mujeres estudiantes de nivel terciario matriculados en un determinado nivel ISCED por el número total de estudiantes (hombres, más mujeres) en ese nivel en un determinado año académico, y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiónes de la localidad, sector y nivel de educación.', 'Divisez le nombre d''étudiantes inscrits dans l''enseignement supérieur d''un niveau spécifié CITE par le nombre total d''étudiants (masculins plus féminins) à ce niveau dans une année universitaire donnée, et multipliez le résultat par 100. Cet indicateur a des valeurs dimensionnelles sur la localité, le secteur et le niveau d''éducation.', NULL, 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(576, NULL, 'Female Teachers Report', 'تقرير عن المعلّمات', '女教师报告', 'Informe Profesoras ', NULL, 'Отчет по женщинам преподавателям', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(577, NULL, 'Divide the total number of female teachers at a given level of education by the total number of teachers (male and female) at the same level in a given school year, and multiply by 100. This indicator has dimension values of locality, sector and level of education.', 'قسّم العدد الإجمالي للمعلمات على مستوى معين من التعليم على العدد الكلي للمعلمين (ذكور وإناث) في نفس المستوى في عام دراسي معين، واضرب نتيجة في 100. هذا المؤشر له قيم البعد للموقع المحلي والقطاع ومستوى التعليم', '女教师总数除以在给定的教育水平在同级别中一个学年的教师总人数（男，女），再乘以100。该指标包含地区，单位和教育程度数据。', 'Se divide el número total de mujeres docentes en un nivel educativo determinado por el número total de maestros (hombres y mujeres) en el mismo nivel en un año escolar dado, y se multiplica por 100. Este indicador tiene valores en las dimensiones de la localidad, sector y nivel de educación.', 'Divisez le nombre total d''enseignantes à un niveau d''enseignement donné par le nombre total d''enseignants (hommes et femmes) au même niveau dans une année scolaire donnée, et multipliez par 100. Cet indicateur a des valeurs dimensionnelles sur la localité, le secteur et le niveau d''éducation.', NULL, 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(578, NULL, 'Private Enrolment Report', 'تقرير الالتحاق الخاص', '私人入学报名', 'Reporte de Matrícula Privada', 'Rapport des Inscriptions Privées', 'Отчет по частному зачислению', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(579, NULL, 'Divide the number of pupils (or students) enrolled in private educational institutions in a given level of education by total enrolment (public and private) at the same level of education, and multiply the result by 100. This indicator has dimension values of sex, locality and level of education.', 'قسّم عدد التلاميذ (أو الطلاب) المسجلين في المؤسسات التعليمية الخاصة في مستوى معين من التعليم على خلال الالتحاق الإجمالي (العام والخاص) على نفس المستوى من التعليم، واضرب النتيجة في 100 هذا المؤشر له قيم البعد للجنسوالموقع المحلي ومستوى التعليم', '划分的学生人数（或学生）就读于私立教育机构在给定的教育水平同等水平的教育总入学率（公共和私人），然后将结果乘以100。该指标包含性别，地区和教育程度数据。', 'Se divide el número de alumnos (o estudiantes) matriculados en instituciones educativas privadas en un determinado nivel de educación por la matrícula total (público y privado) en el mismo nivel de educación, y multiplicar el resultado por 100. Este indicador tiene valores de las dimensiónes de género, localidad y nivel de educación.', 'Divisez le nombre d''élèves (ou étudiants) inscrits dans des établissements d''enseignement privés dans un niveau d''enseignement donné par l''effectif total (public et privé) au même niveau d''éducation, et multipliez le résultat par 100. Cet indicateur a des valeurs dimensionnelles sur le sexe, la localité et le niveau d''éducation.', 'Разделите количество учащихся (или студентов), обучающихся в частных учебных заведениях на данном уровне образования на общее число учащихся (государственных и частных) на том же уровне образования и умножьте результат на 100. Этот показатель различается по полу, местности, сектору и образованию.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(580, NULL, 'Pupil Textbook Ratio Report', 'تقرير معدل التلميذ للكتب', '学生与教材比例报告', 'Informe de proporción de Libros a  alumnos', 'Rapport sur les ratios élèves des Manuels Scolaires', 'Отчет по cоотношению учеников к учебникам ', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(581, NULL, 'Divide the total number of pupils enrolled at the specified level of education by the number of textbooks at the same level. This indicator has dimension values of locality, and sector.', 'قسّم العدد الإجمالي للتلاميذ المسجلين في مستوى تعليمي معيَّن على عدد الكتب المدرسية في نفس المستوى. هذا المؤشر له قيم البعد للموقع المحلي والقطاع', '总数除以学生人数在指定的受教育程度在同级别的教科书由数量。该指标包含地区和单位数据。', 'Se divide el número total de alumnos matriculados en un nivel especificado de la educación por el número de libros de texto en el mismo nivel. Este indicador tiene valores en las dimensiones de la localidad y sector.', 'Divisez le nombre total d''élèves inscrits au niveau d''enseignement donné par le nombre de manuels scolaires au même niveau. Cet indicateur a des valeurs dimensionnelles sur la localité et le secteur privé.', 'Разделить общее количество учащихся на определенный уровень образования на количество учебников на том же уровне. Этот показатель различается по местности,  и секторам.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(582, NULL, 'Water Sources Report', 'تقرير مصادر المياه', '水源报告', 'Informe sobre Fuentes de Agua ', NULL, 'Отчет по источникам воды', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(583, NULL, 'Number of water sources by type. This indicator has dimension values of locality, sector and condition.', 'عدد مصادر المياه وفقا للنوع. هذا المؤشر له قيم البعد للموقع المحلي والقطاع والوضع', '水源数量按类型。该指标包含地区，单位和条件数据。', 'Número de fuentes de agua por tipo. Este indicador tiene valores en las dimensiónes de la localidad, sector y condición.', 'Nombre de sources d''eau par type. Cet indicateur a des valeurs dimensionnelles ', 'Количество источников воды по типу. Этот показатель различается по местности, сектору и условиям.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(584, NULL, 'Sanitation Facilities Report', 'تقرير مرافق الصرف الصحي', '卫生设施报告', 'Informe sobre de las Instalaciones Sanitarias ', NULL, 'Отчет по санитарии', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(585, NULL, 'Number of sanitation facilities by type. This indicator has dimension values of locality, sector and condition.', 'عدد المرافق الصحية حسب النوع. هذا المؤشر له قِيَم البعد للموقع المحلي و والقطاع والوضع', '卫生设施数量按类型。该指标包含地区，单位和条件数据。', 'Número de instalaciones de saneamiento por tipo. Este indicador tiene valores en las dimensiónes de la localidad, sector y condición.', 'Nombre d''installations sanitaires par type. Cet indicateur a des valeurs ', 'Количество санитарных объектов по типу. Этот показатель различается по местности, сектору и условиям.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(586, NULL, 'Public Expenditure per Education Level Report', 'تقرير النفقات العامة لكلّ مستوى تعليميّ', '公共教育支出按教育程度报告', 'Informe del Gasto Público por Nivel de Educación', NULL, 'Отчет по Государственным расходам в зависимости от уровня образования', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(587, NULL, 'Divide total public expenditure for each level of education in a given financial year by the total public expenditure on education for the same financial year and multiply the result by 100. ', 'قسّم إجمالي النفقات العامة على مستوى من مستويات التعليم في سنة مالية معينة على إجمالي النفقات العامة على التعليم للسنة المالية ذاتها واضرب النتيجة في 100', '教育所产生的所有政府机构/部门在给定的财政年度的政府总开支为同一财政年度的公共开支总额除以再乘以100。', 'Se divide el gasto público total para cada nivel de la educación en un determinado año fiscal por el gasto público total en educación para el mismo año fiscal  y multiplicar el resultado por 100.', 'Divisez les dépenses publiques totales pour chaque niveau d''enseignement dans une année donnée financière par le total des dépenses publiques sur l''éducation pour la même année et multipliez le résultat par 100.', NULL, 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(588, NULL, 'Public Expenditure on Education Report', 'تقريرالنفقات العامة على التعليم ', '公共教育开支报告', 'Informe de Gasto Público en Educación ', NULL, 'Отчет по Государственным расходам на образование', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(589, NULL, 'Divide total public expenditure on education incurred by all government agencies/departments in a given financial year by the total government expenditure for the same financial year and multiply by 100.', 'قسّم إجمالي النفقات العامة على التعليم التي تتحملها جميع الجهات/ الإدارات الحكومية   في سنة مالية معينة على إجمالي الإنفاق الحكومي للسنة المالية ذاتها واضرب النتيجة في 100', '教育所产生的所有政府机构/部门在给定的财政年度的政府总开支为同一财政年度的公共开支总额除以再乘以100。', 'Se divide el gasto público total en educación realizados por todas las agencias / departamentos gubernamentales en un año fiscal determinado por el gasto público total para el mismo año y se multiplica por 100.', 'Divisez le total des dépenses publiques d''éducation engagées par tous les organismes gouvernementaux / ministères dans une année financière par le total des dépenses publiques pour la même année financière et multipliez par 100.', 'Разделите общий объем государственных расходов на образование, понесенных всеми государственными учреждениями / департаментами в данном финансовом году на совокупные государственные расходы за тот же финансовый год и умножьте на 100.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(590, NULL, 'Public Expenditure on Education by GNP Report', 'تقرير النفقات العامة على التعليم  حسب إجمالي الناتج القومي', '公共教育开支按 GNP 报告', 'Informe de Gasto Público en Educación por PNB ', NULL, 'Отчет ВВП по Государственным расходам на образование', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(591, NULL, 'Divide total public expenditure on education in a given financial year by the Gross National Product (GNP) or Gross National Income (GNI) of the country for the corresponding year and multiply by 100.', 'قسّم إجمالي النفقات العامة على التعليم في سنة مالية معيّنة على الناتج القومي الإجمالي (GNP) أو الدخل القومي الإجمالي  للبلد للسنة المقابلة واضرب الرقم في 100', '在一个给定的财政年度教育的公共开支总额除以相应年度的国家的国民总收入，再乘以100。', 'Se divide el gasto público total en educación en un  dado  año fiscal  por el producto nacional bruto (PNB) o la Renta Nacional Bruta (RNB) del país para el año correspondiente y se multiplica por 100.', 'Divisez le total des dépenses publiques d''éducation pour une année donnée ', 'Разделите общие государственные расходы на образование в данном финансовом году на валовый национальный продукт (ВНП) или валовой национальный доход (ВНД) страны на соответствующий год и умножьте на 100.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(592, NULL, 'Public Expenditure per Pupil Report', 'تقرير النفقات العامة لكلّ تلميذ', '公共支出的每名学生人均国民生产报告', 'Informe de Gasto Público por Alumno ', NULL, 'Отчет по Государственным расходам на одного ученика ', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
(593, NULL, 'Divide per pupil public current expenditure on each level of education in a given year by the GNI per capita for the same year and multiply by 100. This indicator has dimension values of level of education.', 'قسّم النفقات العامة الحالية لكلّ تلميذ على كل مستوى من مستويات التعليم في سنة معينة من الدخل القومي الإجمالي للفرد لنفس العام و اضرب الرقم في 100 هذا المؤشر له قيم البعد لمستوى التعليم.', '每个在某一年的教育水平，人均国民总收入为同年除以每个学生的公共经常性支出，再乘以100。该指标包含教育程度数据。', 'Se divide por alumno  gasto público actual en todos los niveles de la educación en un año determinado por el INB per cápita en el mismo año y se multiplica por 100. Este indicador tiene valores  en las dimensiones de nivel de eduación.', 'Divisez les dépenses publiques courantes par élève sur chaque niveau d''enseignement pour une année donnée par le RNB par habitant pour la même année et multipliez par 100. Cet indicateur a des valeurs dimensionnelles sur le niveau d''éducation.', 'Разделите текущие общественные расходы на каждого ученика на всех уровнях образования данного года по ВВП на душу населения за тот же год и умножьте на 100. Этот показатель различается по образованию.', 1, '2014-06-25 15:52:55', 1, '2014-06-25 15:31:46'),
